import React from "react";
import './description.css'

const description = () => {
    return (
        <div className="descrip">
            <div className="descriptionbox-navigator">
                <div className="descriptionbox-nav-box">Description</div>
                <div className="descriptionbox-nav-box">Reviews</div>
            </div>
            <div className="descriptionboc-description">
                <p>An e-commerce website is an online platform that enables businesses or individuals to sell products or services over the internet. It allows users to browse a catalog of items, view detailed product information, select sizes or variants, add products to a shopping cart, and proceed to checkout.</p>
            </div>
        </div>
    )
}
export default description;
